        imgUrl='https://upload.wikimedia.org/wikipedia/en/thumb/a/ae/Flag_of_the_United_Kingdom.svg/1200px-Flag_of_the_United_Kingdom.svg.png'
        name='England'
        region='Europe'
        capital='London'
        population='400,5889,111'
      />
    </>
  );
};

export default CardList;
